    false,nt"url": null,nt"notes": "Every year, all parents, all teachers,
    and students take the NYC School Survey. The survey ranks among the largest surveys
    of any kind ever conducted nationally. rnrnSurvey results provide insight into a
    school's learning environment and contribute a measure of diversification that goes
    beyond test scores on the Progress Report. Survey questions assess the community's
    opinions on academic expectations, communication, engagement, and safety and respect.
    School leaders can use survey results to better understand their own school's strengths
    and target areas for improvement. rnrnOver 800,000 New Yorkers participated in the
    survey in 2008. 347,829 parents, 48,002 teachers, and 410,708 students submitted
    surveys and contributed feedback to their schools.",nt"owner_org": "2cc8e4b4-0c38-4590-a002-bd0d74002dec",nt"extras":
